'''
set c = 0

FOR LOOP through t 

    For each index of t, use 

If they are different, return letter

'''

def findTheDifference(s, t):
    c = 0
    for cs in s: 
        print(c,cs)
        print(ord(cs))
        c ^= ord(cs) #ord is ASCII value
        print(c,"\n")
    for ct in t: 
        print(c,ct)
        print(ord(ct))
        c ^= ord(ct) #ord is ASCII value
        print(c,"\n")
    return chr(c) #chr = convert ASCII into character
    

a = "abcd"
b = "abcde"

c = ""
d = "y"

# e = ""
# f = ""



print(findTheDifference(a,b))
print(findTheDifference(c,d))
# print(findTheDifference(e,f))
            
